import React from "react";
import List from "./List";

function App() {
  function item_entered(event) {
    console.log(event.target.value);
  }
  return (
    <div className="container">
      <div className="heading">
        <h1>To-Do List</h1>
      </div>
      <div className="form">
        <input onChange={item_entered} type="text" />
        <button>
          <span>Add</span>
        </button>
      </div>
      <List item="ball" />
      <List item="pen" />
    </div>
  );
}

export default App;
